INSERT INTO `rate_desc` VALUES (1,'Produk ini tidak memenuhi harapan, dengan masalah signifikan seperti kualitas buruk, ketidaksesuaian fungsi, atau kerusakan yang cepat. Pengguna sangat tidak puas.'),(2,'Produk ini memiliki beberapa aspek positif, tetapi kekurangannya lebih dominan. Masalah seperti performa yang kurang konsisten atau bahan yang kurang memadai sering dilaporkan.'),(3,'Produk ini cukup memadai untuk kebutuhan dasar, tetapi tidak menonjol. Beberapa pengguna merasa puas, sementara yang lain menemukan kekurangan kecil, seperti fitur yang terbatas atau daya tahan yang biasa saja.'),(4,'Produk ini berkinerja sangat baik dengan sedikit kekurangan. Pengguna umumnya puas dengan kualitas, fungsi, dan daya tahan, meskipun mungkin ada ruang untuk peningkatan kecil.'),(5,'Produk ini sempurna dalam kualitas dan performa, sepenuhnya memenuhi atau bahkan melampaui harapan pengguna. Sangat direkomendasikan untuk siapa pun yang mencari keandalan dan kepuasan maksimal.');
/*!40000 ALTER TABLE `rate_desc` ENABLE KEYS */;
UNLOCK TABLES;

