CREATE TABLE `user_rate` (
  `username` varchar(20) NOT NULL,
  `order_number` int NOT NULL,
  `product_id` varchar(30) NOT NULL,
  `rating` int NOT NULL,
  PRIMARY KEY (`username`,`order_number`,`product_id`),
  KEY `product_id` (`product_id`),
  KEY `order_number` (`order_number`),
  KEY `rating` (`rating`),
  CONSTRAINT `user_rate_ibfk_1` FOREIGN KEY (`product_id`) REFERENCES `product` (`product_id`),
  CONSTRAINT `user_rate_ibfk_2` FOREIGN KEY (`username`) REFERENCES `customer` (`username`),
  CONSTRAINT `user_rate_ibfk_3` FOREIGN KEY (`order_number`) REFERENCES `order_detail` (`order_number`),
  CONSTRAINT `user_rate_ibfk_4` FOREIGN KEY (`rating`) REFERENCES `rate_desc` (`rating`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
